import React from 'react';
import { OuterWrapper, InnerWrapperFooter, P } from 'styles/MainStyles';
import { Link } from 'react-router-dom';

const Footer = () => {

    return (
    <OuterWrapper>
        <InnerWrapperFooter>
        <P>LINKS</P>
        <P><Link to='/book'>Book a room </Link></P>
        </InnerWrapperFooter>
    </OuterWrapper>
    )
}

export default Footer;
